import {useState} from "react";

function App() {
  const [count, setCount] = useState(0);
  return (
    <>
    <p>{count}</p>
    <button onClick={() => setCount(count + 1)}>plus</button>
    <button onClick={() => setCount(count + 1)}>minus</button>
    <button onClick={() => setCount(0)}>zero</button>
    </>
  );
}

export default App;
